/*
 * Patterns guide:
 * RC = N_CW_PG - std PG road bits, N side of hex is 0x01, clockwise, PG bits 0x01,0x02,0x08,0x10,0x20,0x80
 * NNW_CW = corner top-right = between N and NE = NNE, clockwise, std bits 0x01,0x02,0x04,0x08,0x10,0x20
 * SE_CCW = SE hex side is 0x01, counter clockwise, std bits 0x01,0x02,0x04,0x08,0x10,0x20
 */
